    @SerializedName("recommendation") val recommendation: String = ""
)

data class CreateMobileCraneReportResponse(
    @SerializedName("status") val status: String = "",
    @SerializedName("message") val message: String = "",
    @SerializedName("data") val data: MobileCraneReportData = MobileCraneReportData()
)

// --- Get MobileCrane Reports DTOs ---

data class GetMobileCraneReportsResponse(
    @SerializedName("status") val status: String = "",
    @SerializedName("message") val message: String = "",
    @SerializedName("data") val data: MobileCraneReportsResponseData = MobileCraneReportsResponseData()
)

data class MobileCraneReportsResponseData(
